import React , { useEffect } from 'react'
import { StyleSheet, Text, View, ScrollView } from 'react-native';
import { Provider, useDispatch, useSelector } from 'react-redux'
import { StatusBar } from 'expo-status-bar';
import { getSudokuBoard} from '../store/actions/sudokuActions'


export const Home = () => {
  const dispatch = useDispatch()
  const {sudokuBoard: {board}} = useSelector(state => state.sudokuReducers)

  useEffect( () => {
    dispatch(getSudokuBoard())
  },[dispatch])

  useEffect( () => {
    console.log('masuk',board)
  },[board])

  if(sudokuBoard.length == 0 ) {
    return <Text> please wait ..</Text>
  }

  return (
    <ScrollView contentContainerStyle={styles.container}>
      <Text> ini home </Text>
      {board.length > 0 ? 
        <div>
          {JSON.stringify(board.board)}
          <Text>Open up App.js to start working on your app! Hallo</Text>
        </div>
        :
        null
      }
      <StatusBar style="auto" />
    </ScrollView>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
